import React from "react";
import { Routes, Route } from "react-router-dom";
import Nav from "./components/Nav/Nav"; // افترض أن مكون Nav في مجلد components/Nav
import Home from "./pages/Home"; // صفحة رئيسية
import About from "./pages/About"; // صفحة حول
import Contact from "./pages/Contact"; // صفحة اتصل بنا

function App() {
  return (
    <>
      <Nav />
      <Routes>
  <Route path="/" element={<Home />} />
  <Route path="/about" element={<About />} />
  <Route path="/contact" element={<Contact />} />
  <Route path="/community" element={<Our Community />}>
    <Route path="login" element={<Login />} />
    <Route path="articles" element={<Articles />} />
    <Route path="questions" element={<Questions />} />
  </Route>
</Routes>

    </>
  );
}

export default App;
